<script>
  // calling function that is in euladata_encoding.js which will encode the data&&&.
  function encode_data() {
    
    let data_ele = document.querySelector(".all-agreements-data");
    let liciense_count = document.querySelector(".liciense-count");
    let liciense_elements = document.querySelectorAll("[data-eula-agreements]");
    let agreements_array = []

    for (let i = 0; i < liciense_elements.length; i++) {
        let single_agreement = liciense_elements[i].attributes["data-eula-agreements"].value;
        agreements_array.push(single_agreement);
    }

    let arr = [];
    for (let i = 0; i < agreements_array.length; i++) {
        // Decode base64 (convert ascii to binary)
        var strData = decodeURIComponent(atob(agreements_array[i]));       
        arr.push(strData);
    }
    let all_data = "";
    
    for (let j = 0; j < arr.length; j++) {        
            all_data = all_data + arr[j];
    }
        
    data_ele.innerHTML = all_data;
    liciense_count.innerHTML = arr.length;
    return 1;
}
  
  encode_data();
</script>
